import { Component, OnInit } from '@angular/core';
import { AdminService } from '../admin/admin.service';
import { Router } from '@angular/router';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { AdminComponent } from '../admin/admin.component';

@Component({
  selector: 'app-admin-registration',
  templateUrl: './admin-registration.component.html',
  styleUrls: ['./admin-registration.component.css']
})
export class AdminRegistrationComponent implements OnInit {
  adminForm: FormGroup;

  constructor(private adminService: AdminService, private router: Router, private fb: FormBuilder) {}

  ngOnInit(): void {
    this.adminForm = this.fb.group({
      name: ['', Validators.required],
      email: ['', Validators.required],
      password: ['', Validators.required],
      dept: ['', Validators.required],
      address: ['', Validators.required],
      gender: ['', Validators.required],
    });
  }

  onSubmit(adminData: Admin): void {
    this.adminService.createAdmin(adminData).subscribe(() => {
      this.adminForm.reset();
      console.log('Admin created successfully');
    });
  }

  getAdminsList() {
    this.adminService.getAdmins().subscribe(admins => {
      console.log(admins);
    });
  }

  logout() {
    this.router.navigate(['/login']);
  }
}
<p>admin-registration works!</p>
<h2>Create Admin</h2>

  <form [formGroup]="adminForm" (ngSubmit)="onSubmit(adminForm.value)">
    <div>
      <label for="name">Name:</label>
      <input type="text" id="name" formControlName="name">
    </div>
    <div>
      <label for="email">Email:</label>
      <input type="email" id="email" formControlName="email">
    </div>
    <div>
      <label for="password">Password:</label>
      <input type="password" id="password" formControlName="password">
    </div>
    <div>
      <label for="dept">Department:</label>
      <input type="text" id="dept" formControlName="dept">
    </div>
    <div>
      <label for="address">Address:</label>
      <input type="text" id="address" formControlName="address">
    </div>
    <div>
      <label for="gender">Gender:</label>
      <select id="gender" formControlName="gender">
        <option value="Male">Male</option>
        <option value="Female">Female</option>
      </select>
    </div>
    <div>
      <label for="dob">Date of Birth:</label>
      <input type="date" id="dob" formControlName="dob">
    </div>
    <div>
      <label for="phone">Phone:</label>
      <input type="tel" id="phone" formControlName="phone">
    </div>
    <div>
      <label for="posting">Posting:</label>
      <input type="text" id="posting" formControlName="posting">
    </div>
    <button type="submit">Create Admin</button>
  </form>
